import React from 'react';
import './.css';

interface VehicleDetailsProps {
    make: string;
    model: string;
    year: string;
    plateNumber: string;
    color: string;
    vin: string;
}

const VehicleDetails: React.FC = () => {
    // Get vehicle details from localStorage
    const vehicleDetails = JSON.parse(localStorage.getItem('vehicleDetails') || JSON.stringify({
        make: '',
        model: '',
        year: '',
        plateNumber: '',
        color: '',
        vin: ''
    }));

    return (
        <div className="vehicle-details-container">
            <div className="detail-row">
                <span className="detail-label">Make:</span>
                <span className="detail-value">{vehicleDetails.make || 'Not specified'}</span>
            </div>
            <div className="detail-row">
                <span className="detail-label">Model:</span>
                <span className="detail-value">{vehicleDetails.model || 'Not specified'}</span>
            </div>
            <div className="detail-row">
                <span className="detail-label">Year:</span>
                <span className="detail-value">{vehicleDetails.year || 'Not specified'}</span>
            </div>
            <div className="detail-row">
                <span className="detail-label">Plate Number:</span>
                <span className="detail-value">{vehicleDetails.plateNumber || 'Not specified'}</span>
            </div>
            <div className="detail-row">
                <span className="detail-label">Color:</span>
                <span className="detail-value">{vehicleDetails.color || 'Not specified'}</span>
            </div>
            <div className="detail-row">
                <span className="detail-label">VIN:</span>
                <span className="detail-value">{vehicleDetails.vin || 'Not specified'}</span>
            </div>

            <button className="edit-button">Edit Details</button>
        </div>
    );
};

export default VehicleDetails;
